v.0.0.1-beta
ICPC2 (українськомовна)
Оригинальний переклад українською завдяки 
Романченко Максим Ігорович
http://therapy.odmu.edu.ua/ua/sotrudniki-kafedry/85-sotrudniki-kafedry.html
