*/
DROP TABLE IF EXISTS exclusion;
DROP TABLE IF EXISTS icpc2icd10;
DROP TABLE IF EXISTS demo_icpc2_ua;
CREATE TABLE "demo_icpc2_ua" (
	"code" VARCHAR(3) PRIMARY KEY,
	"name" VARCHAR(100),
	"shorttitle" VARCHAR(100),
	"icd10" VARCHAR(3000),
	"inclusion" VARCHAR(500),
	"exclusion" VARCHAR(500),
	"criteria" VARCHAR(1000),
	"consider" VARCHAR(400),
	"note" VARCHAR(1200)
) ;
CREATE TABLE "exclusion" (
	"code" VARCHAR(3),
	"exclusion" VARCHAR(3),
	 FOREIGN KEY ("code") REFERENCES "demo_icpc2_ua"("code"),
	 FOREIGN KEY ("exclusion") REFERENCES "demo_icpc2_ua"("code")
) ;
CREATE TABLE "icpc2icd10" (
	"icpc2" VARCHAR(3),
	"icd10" VARCHAR(7),
	 FOREIGN KEY ("icpc2") REFERENCES "demo_icpc2_ua"("code"),
	 FOREIGN KEY ("icd10") REFERENCES "icd"("icd_code")
) ;
