INSERT INTO "demo_icpc2_ua" ("code","name","shorttitle","icd10","inclusion","exclusion","criteria","consider","note") VALUES (
'-33','Мікробіологічний / імунологічний тест','Microbiological/immunological test','','аналіз крові; мікробіологічний аналіз сечі; мікробіологічний аналіз калу; мікробіологічний аналіз слини; мікробіологічний зіскоб з горла; мікробіологічна шкірна проба; мікробіологічний аналіз вагінальних виділень; аналіз на антигени або антитіла, наприклад, аналіз на виявлення вірусу імунодефіциту, вірусу папіломи чи гепатиту Б; титр антитіл','проба Манту -32; група крові і резус -34; спермограма -38','аналізи на виявлення бактерій, вірусів чи інших мікроорганізмів','аналіз крові -34; аналіз сечі -35; аналіз калу -36; гістологія або ексфоліативна цитологія -37; біопсія органів / шкіри -52','Хімічні аналізи належать до субстрату / субстанції, де цей аналіз проводиться, в той час, як мікробіологічні / імунологічні аналізи належать до -33, а гістологічні / ексфоліативна цитологія до – 37.');
