INSERT INTO "demo_icpc2_ua" ("code","name","shorttitle","icd10","inclusion","exclusion","criteria","consider","note") VALUES (
'K71','Гостра ревм. лихоманка/хвороба серця','Rheumatic fever/heart disease','I00, I01.0, I01.1, I01.2, I01.8, I01.9, I02.0, I02.9, I05.0, I05.1, I05.2, I05.8, I05.9, I06.0, I06.1, I06.2, I06.8, I06.9, I07.0, I07.1, I07.2, I07.8, I07.9, I08.0, I08.1, I08.2, I08.3, I08.8, I08.9, I09.0, I09.1, I09.2, I09.8, I09.9','хорея; мітральний стеноз','','Для гострої ревматичної лихоманки: два основних, або один основний і два незначних прояви, а також прояв попередньої стрептококової інфекції; - Основні прояви: мігруючий поліартрит; кардит; хорея; ревматоідна еритема; підшкірні вузлики, що недавно з’явились - незначні прояви: лихоманка; артралгія; підвищена ШОЕ або позитивний С-реактивний білок; пролонгований P-R інтервал на ЕКГ – При хронічному ревматизмі серця: або фізичні показники, що співвідносяться з патологічними змінами клапана серця у пацієнта з ревматизмом в анамнезі; або фізичні показники, які співпадають з мітральним стенозом, навіть при відсутності в анамнезі ревматичної лихоманки, але без будь-якої іншої видимої причини','захворювання клапану серця БДУ K83; інші хвороби серця K84','');
