INSERT INTO "demo_icpc2_ua" ("code","name","shorttitle","icd10","inclusion","exclusion","criteria","consider","note") VALUES (
'K86','Гіпертонія неускладнена','Hypertension uncomplicated','I10','гіпертонічна хвороба; артеріальна гіпертонія БДУ; гіпертонія невідомого походження','гіпертонія з ускладненням K87; гіпертонія під час вагітності W81','дві або більше реєстрації показів під час візиту, зроблені під час двох або більше візитів, з кров´яним тиском, що в середньому вище 95 мм рт.ст. діастолічний або більше 160 мм рт.ст. систолічний у дорослих пацієнтів; або два або більше заміри при одноразовій зустрічіі із середнім діастолічним артеріальним тиском 120 мм рт. ст. або вище; плюс відсутність симптомів вторинного залучення серця, нирок, очей або мозку','підвищений кров´яний тиск K85','1) для дітей, звіритись з відповідними педіатричними таблицями кров’яного тиску. 2) якщо є вторинна гіпертонія, ставити також код основної причини');
