INSERT INTO "demo_icpc2_ua" ("code","name","shorttitle","icd10","inclusion","exclusion","criteria","consider","note") VALUES (
'P11','Проблема харчування у дитини','Eating problem in child','F98.2, F98.3','проблеми з годуванням; проблеми з поведінкою дитини під час годування','нервова анорексія / булімія Р86; проблеми харчування дорослого Т05','','','Проблеми, пов´язані з поведінкою дітей, особливо важко класифікувати, що підтверджено фактом того, що вони розподілені між чотирма розділами Міжнародної класифікації первинної медичної допомоги. Якщо батьки будуть обговорювати ці проблеми під час візиту до сімейного лікаря це допоможе їм встановити різницю між нормальною - хоч і набридливою - поведінкою, і поведінкою, яка вважається тривожною або патологічною.');
INSERT INTO "demo_icpc2_ua" ("code","name","shorttitle","icd10","inclusion","exclusion","criteria","consider","note") VALUES (
'P12','Нетримання сечі / енурез','Bedwetting/enuresis','F98.0','','нетримання сечі спричинене розладами внутрішніх органів U04','мимовільне спорожнення сечі вдень / вночі, яке не має встановленого зв´язку з будь-яким розладом органів','','Проблеми, пов´язані з поведінкою дітей, особливо важко класифікувати, що підтверджено фактом того, що вони розподілені між чотирма розділами Міжнародної класифікації первинної медичної допомоги. Якщо батьки будуть обговорювати ці проблеми під час візиту до сімейного лікаря це допоможе їм встановити різницю між нормальною - хоч і набридливою - поведінкою, і поведінкою, яка вважається тривожною або патологічною.');
