INSERT INTO "demo_icpc2_ua" ("code","name","shorttitle","icd10","inclusion","exclusion","criteria","consider","note") VALUES (
'P15','Хронічне зловживання алкоголем','Chronic alcohol abuse','F10.1, F10.2, F10.3, F10.4, F10.5, F10.6, F10.7, F10.8, F10.9, G31.2','алкогольний синдром мозку; алкогольний психоз; алкоголізмом; біла гарячка','','розлади внаслідок вживання алкоголю, що призводять до одного або більше наступних наслідків: шкідливого вживання з завданням клінічно істотної шкоди здоров´ю; синдром залежності; стан абстиненції; психотичний розлад','','Визначення терміну зловживання речовинами повинне враховувати суттєві відмінності між країнами і культурами. Лікар може прийняти рішення позначити випадок як хронічне зловживання алкоголем без згоди пацієнта,але тим самим спричинити небажання пацієнта погодитись на будь-яку медичну допомогу.');
INSERT INTO "demo_icpc2_ua" ("code","name","shorttitle","icd10","inclusion","exclusion","criteria","consider","note") VALUES (
'P16','Гостра алкогольна інтоксикація','Acute alcohol abuse','F10.0','алкогольна інтоксикація','','розлади внаслідок вживання алкоголю, що призводять до гострої інтоксикації, з / без історії хронічного зловживання','','Лікар може прийняти рішення позначити випадок як хронічне зловживання алкоголем без згоди пацієнта,але тим самим спричинити небажання пацієнта погодитись на будь-яку медичну допомогу.');
INSERT INTO "demo_icpc2_ua" ("code","name","shorttitle","icd10","inclusion","exclusion","criteria","consider","note") VALUES (
'P17','Зловживання тютюном','Tobacco abuse','F17.0, F17.1, F17.2, F17.3, F17.4, F17.5, F17.6, F17.7, F17.8, F17.9','зловживання тютюном','','розлади внаслідок паління, що призводять до одного або більше наступних наслідків: шкідливого вживання з завданням клінічно істотної шкоди здоров´ю; синдром залежності; стан абстиненції;','фактор ризику БДУ А23','Визначення терміну зловживання речовинами повинне враховувати суттєві відмінності між країнами і культурами. Пацієнт, що має алкогольну або героїнову залежність, потребує медичної допомоги, але визначення зловживання тютюном є суперечливим. Лікар може прийняти рішення позначити випадок як зловживання тютюном без згоди пацієнта,але тим самим спричинити небажання пацієнта погодитись на будь-яку медичну допомогу.');
INSERT INTO "demo_icpc2_ua" ("code","name","shorttitle","icd10","inclusion","exclusion","criteria","consider","note") VALUES (
'P18','Зловживання ліками','Medication abuse','F13.0, F13.1, F13.2, F13.3, F13.4, F13.5, F13.6, F13.7, F13.8, F13.9, F19.0, F19.1, F19.2, F19.3, F19.4, F19.5, F19.6, F19.7, F19.8, F19.9, F55','зловживання медичними преператами','','','','Визначення терміну зловживання речовинами повинне враховувати суттєві відмінності між країнами і культурами. Деякі пацієнти просять і використовують седативні засоби, снодійне, анорексигенні і проносні засоби невідповідно і занадто довго. У цих випадках лікар може прийняти рішення позначити випадок як зловживання медичними препаратами без згоди пацієнта,але тим самим спричинити небажання пацієнта погодитись на будь-яку медичну допомогу.');
