'P19','Вживання наркотиків','Drug abuse','F11.0, F11.1, F11.2, F11.3, F11.4, F11.5, F11.6, F11.7, F11.8, F11.9, F12.0, F12.1, F12.2, F12.3, F12.4, F12.5, F12.6, F12.7, F12.8, F12.9, F13.0, F13.1, F13.2, F13.3, F13.4, F13.5, F13.6, F13.7, F13.8, F13.9, F14.0, F14.1, F14.2, F14.3, F14.4, F14.5, F14.6, F14.7, F14.8, F14.9, F15.0, F15.1, F15.2, F15.3, F15.4, F15.5, F15.6, F15.7, F15.8, F15.9, F16.0, F16.1, F16.2, F16.3, F16.4, F16.5, F16.6, F16.7, F16.8, F16.9, F18.0, F18.1, F18.2, F18.3, F18.4, F18.5, F18.6, F18.7, F18.8, F18.9, F19.0, F19.1, F19.2, F19.3, F19.4, F19.5, F19.6, F19.7, F19.8, F19.9','наркотична залежність; наркотична абстиненція','','Розлади пов´язані з використанням психо-активних речовин, які викликають звикання, що призводить до одного або більше наступних шкідливих наслідків: гостра інтоксикація; шкідливе вживання з клінічно значимою шкодою здоров´ю; синдром залежності; стан абстиненції; психотичний розлад','','Визначення терміну зловживання речовинами повинне враховувати суттєві відмінності між країнами і культурами. Пацієнт, що має алкогольну або героїнову залежність, потребує медичної допомоги, але визначення використання гашишу є суперечливим. Лікар може прийняти рішення позначити випадок як зловживання наркотичними засобами без згоди пацієнта,але тим самим спричинити небажання пацієнта погодитись на будь-яку медичну допомогу.');
