'P72','Шизофренія','Schizophrenia','F20.0, F20.1, F20.2, F20.3, F20.4, F20.5, F20.6, F20.8, F20.9, F21, F22.0, F22.8, F22.9, F24, F25.0, F25.1, F25.2, F25.8, F25.9, F28','всі види параної; всі типи шизофренії','гострий / перехідний психоз P98','фундаментальні і характерні спотворення мислення, сприйняття і емоціонального стану, які є неадекватними або притупленими (наприклад, пацієнт чує свої думки, має навязані думки або думки, які забрали, має маячні сприйняття, чує галюцинаторні голоси, має манію контролю), в той же ж час маючи ясну свідомість і неушкоджений інтелектуальний потенціал.','психоз БДУ P98','');
INSERT INTO "demo_icpc2_ua" ("code","name","shorttitle","icd10","inclusion","exclusion","criteria","consider","note") VALUES (
'P73','Афективний психоз','Affective psychosis','F30.0, F30.1, F30.2, F30.8, F30.9, F31.0, F31.1, F31.2, F31.3, F31.4, F31.5, F31.6, F31.7, F31.8, F31.9, F34.0','біполярний розлад; гіпоманія; манія; маніакальна депресія','депресивний розлад Р76','фундаментальне порушення емоціонального стану і настрою (з / без пов´язаним тривожним станом), У стані маніакального розладу рівень енергії і активності є одночасно підвищеними. При біполярному захворюванні спостерігається принаймні два періоди падіння і піднесення настрою.','психоз БДУ P98','');
INSERT INTO "demo_icpc2_ua" ("code","name","shorttitle","icd10","inclusion","exclusion","criteria","consider","note") VALUES (
'P74','Тривожний розлад','Anxiety disorder/anxiety state','F41.0, F41.1, F41.3, F41.8, F41.9','невроз тривоги; панічний розлад','відчуття тривоги БДУ P01; відчуття тривоги та депресивний розлад P76','клінічно значиме занепокоєння, що не обмежується ніякою конкретної навколишньою ситуацією. Це проявляється у вигляді панічного розладу (повторювані напади важкої тривоги не обмежуються будь-якою конкретною ситуацією, з або без фізичних симптомів) або як розлад, під час якого відчуття загальної і постійної тривоги, не пов´язаної з будь-якої конкретної ситуацією, виникає з різними фізичними симптомами','відчуття тривоги / нервування / напруженості P01','');
INSERT INTO "demo_icpc2_ua" ("code","name","shorttitle","icd10","inclusion","exclusion","criteria","consider","note") VALUES (
'P75','Психосоматичний розлад','Somatization disorder','F44.0, F44.1, F44.2, F44.3, F44.4, F44.5, F44.6, F44.7, F44.8, F44.9, F45.0, F45.1, F45.2, F45.3, F45.4, F45.9','конверсійний розлад; іпохондричний розлад; істерія; псевдовагітність','','Соматизований розлад характеризується надмірною стурбованістю і постійною присутністю фізичних симптомів і скарг, а також постійною вимогою медичного огляду, незважаючи на неодноразові негативні результати і запевнення з боку лікарів. Для цього діагнозу потрібна наявність множинних, рецидивуючих і часто мінливих симптомів, які спостерігає сімейний лікар протягом не менше одного року. Іпохондричний розлад вимагає постійну стурбованість зовнішністю або можливістю мати серйозне захворювання, а також постійні соматичні скарги протягом періоду, щонайменше, одного року, не дивлячись на неодноразові негативні результати і запевнення лікарів.','','Соматизацією є постійна наявність фізичних симптомів і скарг, що припускають фізичні розлади, за які не відповідають жодні очевидні показники організму чи фізіологічні механізми і для яких є позитивні докази того, що вони пов’язані з психологічними факторами, в той час як пацієнт зовсім не має відчуття контролю над спричиненням виникнення цих симптомів при вирішенні психологічних факторів. Фізичні симптоми і скарги, включаючи біль, які представлені, ніби вони спричинені фізичним розладом системи / органа під автономною регуляцією нервової системи, або які складаються з постійного, сильного болю / болісних відчуттів, які неможливо пояснити фізіологічним процесом / розладом, отримують код симптома / скарги діагноза що представляють фізичний аспект, і –якщо можливо - код, що представляє емоційну або психологічну проблему, з якою він пов´язаний. Визначення соматизаційного розладк в МКБ-10 (як мінімум 2 роки) є занадто жорстким для використання в загальній практиці.');
INSERT INTO "demo_icpc2_ua" ("code","name","shorttitle","icd10","inclusion","exclusion","criteria","consider","note") VALUES (
'P76','Депресивний розлад','Depressive disorder','F32.0, F32.1, F32.2, F32.3, F32.8, F32.9, F33.0, F33.1, F33.2, F33.3, F33.4, F33.8, F33.9, F34.1, F34.8, F34.9, F38.0, F38.1, F38.8, F39, F41.2, F53.0','депресивний невроз / психоз; змішана тривога і депресія; післяродова / післяпологова депресія; реактивна депресія','гостра реакція на стрес P02','фундаментальне порушення, що негативно впливає на настрій, схильний до депресії. Настрій, енергія і активність одночасно знижуються, разом з порушеною здатністю до насолоди, інтересом і концентрацією. Сон і апетит, як правило, порушуються, а почуття власної гідності і впевненості знижуються','пригнічений настрій P03','');
