INSERT INTO "demo_icpc2_ua" ("code","name","shorttitle","icd10","inclusion","exclusion","criteria","consider","note") VALUES (
'P78','Неврастенія / перевтома','Neuraesthenia/surmenage','F48.0','','','підвищена стомлюваність з неприємними асоціаціями, труднощі з концентрацією і постійне зниження продуктивності і ефективності подолання труднощів; відчуття фізичної слабкості і виснаження після розумових зусиль або після мінімального фізичного навантаження, часто супроводжується м´язовим болем і нездатністю розслабитися','втома / поствірусна втома / синдром хронічної втоми A04','');
INSERT INTO "demo_icpc2_ua" ("code","name","shorttitle","icd10","inclusion","exclusion","criteria","consider","note") VALUES (
'P79','Фобія / компульсивний розлад','Phobia/compulsive disorder','F40.0, F40.1, F40.2, F40.8, F40.9, F42.0, F42.1, F42.2, F42.8, F42.9','','','фобічний тривожний розлад вимагає вираження тривоги, виникає тільки в чітко визначених ситуаціях, які зазвичай не вважаються небезпечними: пацієнт намагається уникати таких ситуацій, або переносить їх з жахом. Обсесивно-компульсивний розлад характеризується наявністю болісних повторюваних нав´язливих думок / дій, які пацієнт вважає власними; нав´язливі стереотипні моделі поведінки повторюються знову і знову, спрямовані на запобігання якоїсь об´єктивної малоймовірної події,пацієнт усвідомлює їх безглуздість та неефективність','','');
INSERT INTO "demo_icpc2_ua" ("code","name","shorttitle","icd10","inclusion","exclusion","criteria","consider","note") VALUES (
'P80','Розлад особистості','Personality disorder','F60.0, F60.1, F60.2, F60.3, F60.4, F60.5, F60.6, F60.7, F60.8, F60.9, F61, F62.0, F62.1, F62.8, F62.9, F63.0, F63.1, F63.2, F63.8, F63.9, F68.0, F68.1, F68.8, F69','розлади поведінки у зрілому віці; компенсаційний невроз; синдром Мюнхгаузена; психопатія','','тривалі і клінічно важливі стани і моделі поведінки в способі життя індивіда і спосіб відношення до себе та інших, що відображає значні / крайні відхилення від того, як індивід сприймається, почувається і поводиться у певному суспільстві. Ця модель глибоко вкоренилася і є довговічною','','');
