'Z02','Проблема з харчами/водою','Food/water problem','Z58.6, Z59.4','','','','','Проблеми умов життя в першу чергу вимагають висловити занепокоєння пацєнтом, із визнанням проблеми та прийняттям допомоги. За будь-яких об´єктивних умов, пацієнти можуть вважати це проблемою. Маркування даних проблем вимагає визнання абсолютних відмінностей умов життя, як і індивідуального сприйняття.');
INSERT INTO "demo_icpc2_ua" ("code","name","shorttitle","icd10","inclusion","exclusion","criteria","consider","note") VALUES (
'Z03','Проблема з житлом /районом проживання','Housing/neighbourhood problem','Z59.0, Z59.1, Z59.2, Z59.3, Z59.8, Z59.9','','','','','Проблеми умов проживання в першу чергу вимагають, щоб сам пацієнт висловив своє занепокоєння, визнав існування проблеми та висловив бажання прийняти допомогу. Які б не були об´єктивні умови життя, для пацієнтів це може бути проблемою. Маркування цих проблем вимагає визнання абсолютних відмінностей в умовах проживання, та у їх індивідуальному сприйнятті.');
INSERT INTO "demo_icpc2_ua" ("code","name","shorttitle","icd10","inclusion","exclusion","criteria","consider","note") VALUES (
'Z04','Соціально-культурна проблема','Social cultural problem','Z60.1, Z60.2, Z60.3, Z60.4, Z60.5, Z60.8, Z60.9','нелегітимна вагітність','небажана вагітність W79','','','Проблеми умов життя в першу чергу вимагають щоб пацієнт висловив занепокоєння та визнав існування проблеми та мав бажання прийняти допомогу. За будь-яких об´єктивних умов, для пацієнта це може бути проблемою. Маркування даних проблем вимагає визнання абсолютних відмінностей умов життя, як і індивідуального сприйняття.');
INSERT INTO "demo_icpc2_ua" ("code","name","shorttitle","icd10","inclusion","exclusion","criteria","consider","note") VALUES (
'Z05','Проблема з роботою','Work problem','Z56.1, Z56.2, Z56.3, Z56.4, Z56.5, Z56.6, Z56.7, Z57.0, Z57.1, Z57.2, Z57.3, Z57.4, Z57.5, Z57.6, Z57.7, Z57.8, Z57.9','','','','','Проблеми умов праці в першу чергу вимагають щоб пацієнт висловив занепокоєння та визнав існування проблеми та мав бажання прийняти допомогу. За будь-яких об´єктивних умов, для пацієнта це може бути проблемою. Маркування даних проблем вимагає визнання абсолютних відмінностей умов праці, як і індивідуального сприйняття.');
INSERT INTO "demo_icpc2_ua" ("code","name","shorttitle","icd10","inclusion","exclusion","criteria","consider","note") VALUES (
'Z06','Проблема з безробіттям','Unemployment problem','Z56.0','','проблема пенсійного віку P25','','','Проблеми безробіття в першу чергу вимагають щоб пацієнт висловив занепокоєння, визнав існування проблеми та мав бажання прийняти допомогу. За будь-якихпричинта видівбезробіття, для пацієнта це може бути проблемою. Маркування даних проблем вимагає визнання абсолютнихвідмінностейміж видами безробіття, як і індивідуального сприйняття.');
INSERT INTO "demo_icpc2_ua" ("code","name","shorttitle","icd10","inclusion","exclusion","criteria","consider","note") VALUES (
'Z07','Проблема з освітою','Education problem','Z55.0, Z55.1, Z55.2, Z55.3, Z55.4, Z55.8, Z55.9','неграмотність','','','','Проблеми освіти в першу чергу вимагають, щою пацієнт висловив занепокоєння, визнав існування проблеми та мав бажання прийняти допомогу. За будь-якого об´єктивного освітнього статусу, для пацієнта це може бути проблемою. Маркування даних проблем вимагає визнання абсолютних відмінностей рівня та видів освіти, як і індивідуального сприйняття.');
INSERT INTO "demo_icpc2_ua" ("code","name","shorttitle","icd10","inclusion","exclusion","criteria","consider","note") VALUES (
'Z08','Проблема з соціальним забезпеченням','Social welfare problem','Z59.7','','','','','Проблеми соціального добробуту в першу чергу вимагають. щоб пацієнт висловив занепокоєнн, визнав існування проблеми та мав бажання прийняти допомогу. За будь-якої об´єктивної ситуації соціального добробуту, для пацієнта це може бути проблемою. Маркування даних проблем вимагає визнання абсолютних відмінностей у соціальному добробуті, як і індивідуального сприйняття.');
INSERT INTO "demo_icpc2_ua" ("code","name","shorttitle","icd10","inclusion","exclusion","criteria","consider","note") VALUES (
'Z09','Юридична проблема','Legal problem','Z65.0, Z65.1, Z65.2, Z65.3','','','','','Проблеми правових питань в першу чергу вимагають, щоб пацієнт висловив занепокоєння, визнав існуванння проблеми та мав бажання прийняти допомогу. Якою б не були об´єктивні юридичні проблеми, для пацієнтів це може бути проблемою. Маркування даних проблем вимагає визнання абсолютних відмінностей у юридичних питаннях а також індивідуального сприйняття.');
INSERT INTO "demo_icpc2_ua" ("code","name","shorttitle","icd10","inclusion","exclusion","criteria","consider","note") VALUES (
'Z10','Проблема з системою охорони здоров´я','Health care system problem','Z64.4, Z75.0, Z75.1, Z75.2, Z75.3, Z75.4, Z75.5, Z75.8, Z75.9','','','','','Проблеми системи охорони здоров´я вимагають в першу чергу щою пацієнт висловив занепокоєння, визнав існування проблеми та мав бажання отримати допомогу. Якою б не була система охорони здоров´я, для пацієнтів це може бути проблемою. Маркування даних проблем вимагає визнання абсолютних відмінностей у системі охорони здоров´я як і у індивідуальному сприйнятті.');
INSERT INTO "demo_icpc2_ua" ("code","name","shorttitle","icd10","inclusion","exclusion","criteria","consider","note") VALUES (
'Z11','Проблема прихильності до лікування','Compliance/being ill problem','Z75.0, Z75.1, Z75.2, Z75.3, Z75.4, Z75.5, Z75.8, Z75.9','недостатні дотримання інструкцій / вимог','','','','Діагностування соціальних проблем,що виникають внаслідок хвороби вимагає визнання пацієнтом існування проблеми та бажання отримати допомогу.');
INSERT INTO "demo_icpc2_ua" ("code","name","shorttitle","icd10","inclusion","exclusion","criteria","consider","note") VALUES (
'Z12','Проблема відносин із партнером','Relationship problem with partner','T74.0, T74.3, Z63.0','емоційне насильство','фізичне насильство з боку партнера Z13; жертва фізичного насилля Z25','','','Діагностування проблем відносин між партнерами у сім´ї вимагає визнання пацієнтом існування проблеми та бажання отримати допомогу.');
INSERT INTO "demo_icpc2_ua" ("code","name","shorttitle","icd10","inclusion","exclusion","criteria","consider","note") VALUES (
'Z13','Проблема з поведінкою партнера','Partner´s behaviour problem','Z63.0','подружня зрада; фізмчне насилля','жертва фізичного насилля Z25','','','Діагностування проблем, що виникають у поведінці партнера у сім´ї вимагає визнання пацієнтом існування проблеми та бажання отримати допомогу.');
INSERT INTO "demo_icpc2_ua" ("code","name","shorttitle","icd10","inclusion","exclusion","criteria","consider","note") VALUES (
'Z14','Проблема пов´язана з хворобою партнера','Partner illness problem','Z63.6','','','','','Діагностування проблем, що виникають через хворобу одного або обох партнерів у сім´ї вимагає визнання пацієнтом існування проблеми та бажання отримати допомогу.');
INSERT INTO "demo_icpc2_ua" ("code","name","shorttitle","icd10","inclusion","exclusion","criteria","consider","note") VALUES (
'Z15','Проблема з втратою/смертю партнера','Loss/death of partner problem','Z63.4, Z63.5','втрата близької людини; розлучення; окреме проживання','','','','Діагностування проблем, що виникають внаслідок втрати або смерті одного із партнерів вимагає визнання пацієнтом існування проблеми та бажання отримати допомогу.');
INSERT INTO "demo_icpc2_ua" ("code","name","shorttitle","icd10","inclusion","exclusion","criteria","consider","note") VALUES (
'Z16','Проблема відносин з дитиною','Relationship problem with child','T74.0, T74.3, Z61.0, Z61.1, Z61.2, Z61.3, Z61.4, Z61.5, Z61.6, Z61.7, Z61.8, Z61.9, Z62.0, Z62.1, Z62.2, Z62.3, Z62.4, Z62.5, Z62.6, Z62.8, Z62.9, Z63.8','насилля над дітьми (емоційне)','фізичне несилля Z25','','','Діагностування проблем відносин з дитиною вимагає визнання пацієнтом існування проблеми та бажання отримати допомогу.');
INSERT INTO "demo_icpc2_ua" ("code","name","shorttitle","icd10","inclusion","exclusion","criteria","consider","note") VALUES (
'Z18','Проблема, пов´язана з хворобою дитини','Illness problem with child','Z63.6','','','','','Діагностування проблем,що виникають через хворобу дитини вимагає визнання пацієнтом існування проблеми та бажання отримати допомогу.');
INSERT INTO "demo_icpc2_ua" ("code","name","shorttitle","icd10","inclusion","exclusion","criteria","consider","note") VALUES (
'Z19','Проблема з втратою/смертю дитини','Loss/death of child problem','Z63.4','','','','','Діагностування проблем, що виникають через втрату або смерть дитини у сім´ї вимагає визнання пацієнтом існування проблеми та бажання отримати допомогу.');
INSERT INTO "demo_icpc2_ua" ("code","name","shorttitle","icd10","inclusion","exclusion","criteria","consider","note") VALUES (
'Z20','Проблема відносин з батьками/сім´єю','Relationship problem parent/fam memb','T74.0, Z63.1, Z63.8','проблема у відносинах із одним з батьків / дорослим братом або сестрою / іншим членом сім´ї','проблема відносин з партнером Z12; проблема відносин з дитиною Z16; проблема відносин із другом Z24','','','Діагностування проблем у відносинах між членами сім´ї вимагає визнання пацієнтом існування проблеми та бажання отримати допомогу.');
