'Z21','Проблема поведінки з батьками/сім´єю','Behaviour problem parent/fam memb','Z63.1, Z63.9','','поведінка дитини симптом / скарга P22; поведінка підлітка - симптом / скарга P23; проблема із поведінкою партнера Z13','','','Діагностування проблем,що виникають через поведінку одного із членів сім´ї вимагає визнання пацієнтом проблеми та бажання отримати допомогу.');
