'Z22','Проблема з хворобою батьків/члена сім´ї','Illness problem parent/family memb','Z63.6, Z63.7','','проблема через хворобу партнера Z14','','','Діагностування проблем, що виникають через хворобу члена сім´ї вимагає визнання пацієнтоміснування проблеми та бажання отримати допомогу.');
