'Z23','Втрата/смерть батьків/члена сім´ї','Loss/death parent/fam memb problem','Z63.4','','втрата партнера Z15; втрата дитини Z19','','','Діагностування проблем, що виникають через втрату або смерть члена сім´ї вимагає визнання пацієнтом існування проблеми та бажання отримати допомогу.');
