'Z24','Проблема відносин з другом','Relationship problem friend','Z63.9','','проблема у відносинах із членом сім´ї Z20','','','Діагностування проблеми відносин із друзями вимагає визнання пацієнтом існування проблеми та бажання отримати допомогу.');
