'Z25','Проблема з нападом/небезпечною подією','Assault/harmful event problem','T74.1, T74.2, T74.8, T74.9, Z65.4, Z65.5','жертва фізичного насилля; жертва згвалтування; жертва сексуального нападу','емоційне насилля з боку партнера Z12; фізичне насилля з боку партнера Z13; емоціне насилля над дитиною Z16; психологічні проблеми кодувати у Розділі Р; фізичні проблеми кодувати у відповідних частинахв інших розділах','','','Діагностування соціальних проблем, що виникають внаслідок нападів та інших небезпечних ситуацій вимагає визнання пацієнтом існування проблеми та бажання отримати допомогу.');
